package com.sxdl.drplus.controller;


import com.sxdl.base.dao.dao1.SysUserDao;
import com.sxdl.base.entity.SysUser;
import com.sxdl.base.util.ResultUtil;
import io.swagger.annotations.Api;
import io.swagger.annotations.ApiOperation;
import lombok.Data;
import lombok.RequiredArgsConstructor;
import lombok.experimental.Accessors;
import org.springframework.web.bind.annotation.GetMapping;
import org.springframework.web.bind.annotation.RequestMapping;
import org.springframework.web.bind.annotation.RequestParam;
import org.springframework.web.bind.annotation.RestController;

import java.io.Serializable;

@Api(tags = "表单" )
@RestController
@RequestMapping("/sysCustomForm")
@RequiredArgsConstructor
public class SysCustomForm {

    private final SysUserDao userDao;

    /**
     * key 模拟数据,后面使用人员有Bug 可以将他们的数据表复制过来,此接口的数据直接给json文件
     * @param userCode
     * @return
     */
    @ApiOperation(value = "根据角色id获取角色内容" )
    @GetMapping("/getRoleData")
    public ResultUtil getRoleData(@RequestParam(value = "userCode",required = true) String userCode) {


        SysUser sysUser = new SysUser();
        //sysUser.setStatus(2);
        sysUser.setCode(userCode);
        SysUser sysUser1 = userDao.selectOne(sysUser);
        UserDBO userDBO = new UserDBO()
                .setOwner_department(sysUser1.getKk_ks())
                .setOwner_user(sysUser1.getCode())
                .setKs_role("|"+sysUser1.getKk_ks()+"|")
                .setUser_role(sysUser1.getCode())
                .setSignature("data:image/jpg;base64,");
        return ResultUtil.success ( userDBO );
    }

    @Data
    @Accessors(chain = true) //set链式编程
    class UserDBO implements Serializable {
       private String owner_department;
       private String ks_role;
       private String user_role;
       private String owner_user;
       private String signature;

    }


}
